(1, 'home', 'Creativeitem | Premium UI Kits & Software Solutions for Every Niche hello', '[{\"value\":\"Home\"},{\"value\":\"Landing page\"}]', 'High-quality UI components and tailored software solutions available for your niche. Discover web applications: school management system, real estate listings, private social networks, LMS softwares; and UI elements available for purchase or subscription.', 'xxxxxx', 'https://crativeitem.com', 'https://crativeitem.com', '<script type=\"application/ld+json\"> {   \"@context\": \"http://schema.org\",   \"@type\": \"WebSite\",   \"name\": \"CodeCanyon\",   \"url\": \"https://codecanyon.net\" } </script>', 'ooooooooo', 'zzzzzzzzzz', 'OG-home.jpg'),
(2, 'web_applications', 'Discover Web Applications: Workplace, LMS, Social Network & More', NULL, 'Increase productivity with a range of precisely curated Web Applications by Creativeitem. Dive into our innovative web applications for your specific needs: Workplace, LMS, Social Network, and more for tailored solutions.', NULL, NULL, NULL, NULL, 'Creativeitem web-applications', NULL, 'OG-web-application.jpg'),
(3, 'docs', 'Comprehensive Documentation: Workplace, LMS, Sociopro, & more', NULL, 'Access formal documentation insights for all web applications by Creativeitem. Get the help with installation, troubleshooting, usage guides and every other detail related to our products, all in one page.', NULL, NULL, NULL, NULL, NULL, NULL, 'OG-documantation.jpg'),
(4, 'blog', 'Explore product knowledge, key trends & insights blogs hello', NULL, 'Gain in-depth perspectives on our products and market insights through perceptive and educational blog entries. Our valuable blogs provide you with expert tips, insights & current trends to keep you up-to-date', NULL, NULL, NULL, NULL, NULL, NULL, 'OG-Blog.jpg'),
(5, 'services', 'Discover Our Services: Custom Projects Aligned with Your Vision', NULL, 'Submit your project requirements to receive customized solutions aligned to your needs. Explore our services and expect Creativeitem to deliver your tailored project effortlessly and designed to blend with your requirements.', NULL, NULL, NULL, NULL, NULL, NULL, 'OG-service.jpg'),
(6, 'elements', 'Enhance Design Flow with UI kits, Figma components, HTML & more', 'ui kits, website template, video template', 'Fuel your design journey with Creativeitem\'s Elements. Explore UI kits, Figma components, HTML templates, video components, 3D elements, graphics: a variety of design toolkits available for your creativity.', NULL, NULL, NULL, NULL, NULL, NULL, 'OG-elements home.jpg'),
(7, 'elements_package_pricing', 'Creative elements - pricing', 'elements, package, pricing, subscription', 'Best and affordable subscription packages', NULL, 'https://creativeitem.com/elements/pricing', 'https://creativeitem.com/elements/pricing', NULL, NULL, NULL, 'OG-Pricing.jpg'),
